description:
Make sure you have already downloaded utorrent and winrar in order to download and open this file.

Extract file to document or wherever you feel like putting the file.

then follow these steps.



0. Click on &quot;setup&quot; and start the download

1. Open &quot;xf-sms50&quot;. Generate a serial a few times, copy/paste the &quot;Serial&quot; and click on &quot;register license&quot;

2. Choose &quot;Verify license right now&quot;

3. Choose &quot;Perform manually&quot;

4. Copy/paste all 11 authentication blocks in the keymaker area &quot;Request&quot;
   (66 digits, NO spaces or dashes. It's all together.)

5. Press the middle button &quot;ACTIVATE&quot; and copy the result in &quot;Activation&quot; and paste them in manga studio.



That's it. The instruction will also be with the files too.
